Code: 400 Bad Request 
Content: InvalidParameterTypeError | InvalidParameterValueRangeError
Code: 404 Not Found 
Content: NotFoundResourceError

Sample Call:
axios.get('/datums?offset=10&limit=10')
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });

Update

Update datum. Server should check next rules:

check consistency between fields and local data source metadata and transformation
check consistency between datum's fields and fields in dependent looks

URL
/datums/:id
Method:
PUT
URL Params:



Property
Type
Description




id
String
Unique datum id



Data Params:

Datum

Success Response:

Code: 204 No Content 
Content: None

Error Response:

Code: 400 Bad Request 
Content: InvalidParameterTypeError | InvalidParameterValueRangeError
Code: 403 Forbidden 
  Content: BrokenDependentResourcesError

Sample Call:
axios.post('/datums/1234', {
    id: '1234',
    name: 'population-of-usa',
    title: "Population of USA",
    data: {
      url: 'https://example.com/data/some.csv',
      format: {
        type: 'csv',
        parse: {
          population: 'number',
          age: 'number',
          year: 'date'
        },
      }
    },
   fields: [
     { 
       name: "population", 
       title: "Population blhabla",
       variable: {
         type: 'number',
         dependent: false
       }
     },
     { 
       name: "age", 
       title: "Age foooo",
       variable: {
        type: 'number',
        dependent: false
       }
     }
    ],
    authority: {
      name: 'example',
      site: 'https://example.com/my-data-information'
    }
  })
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });

